import styled from 'styled-components';

export const Container = styled.div`
        position: absolute;
        background-color: red;
        width: 100%;
        margin-bottom: 100px;
        margin-top: 100px;
`

export const Card = styled.div`
    margin-bottom: 100px;
    margin-top: 100px;
`
